import React from 'react';
import '../style/Home.css';

const Home = () => {
  return (
    <div className="home">
      <h1>Патоморфологическая Лаборатория</h1>
      <p>Лаборатория оснащена новейшим оборудованием по стандартам США.</p>
      {/* The image would be a background set via CSS */}
      <div className="home-image"></div>
    </div>
  );
};

export default Home;
